package db.domain;import java.util.Arrays;public class TacticalImpl implements Tactical , 
				UserItem
			, 
				TacticalDTO
			{	@Key	private String uname;	@Key	private int ids;	private int templetId;	private int level;	private boolean iscurrent;	private float accumulate;	public TacticalImpl() {	}	public TacticalImpl(Tactical c) {		this.uname = c.getUname();		this.ids = c.getIds();		this.templetId = c.getTempletId();		this.level = c.getLevel();		this.iscurrent = c.getIscurrent();		this.accumulate = c.getAccumulate();	}	@Override	public String tableName() {		return "tactical";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setIds(int ids) {		this.ids = ids;	}	public int getIds() {		return this.ids;	}public void addIds(int ids) {		this.ids += ids;}	public void setTempletId(int templetId) {		this.templetId = templetId;	}	public int getTempletId() {		return this.templetId;	}public void addTempletId(int templetId) {		this.templetId += templetId;}	public void setLevel(int level) {		this.level = level;	}	public int getLevel() {		return this.level;	}public void addLevel(int level) {		this.level += level;}	public void setIscurrent(boolean iscurrent) {		this.iscurrent = iscurrent;	}	public boolean getIscurrent() {		return this.iscurrent;	}	public void setAccumulate(float accumulate) {		this.accumulate = accumulate;	}	public float getAccumulate() {		return this.accumulate;	}public void addAccumulate(float accumulate) {		this.accumulate += accumulate;}}